/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<section    class="ui5-carousel-root"    tabindex="0"    role="listbox"    aria-activedescendant="${ifDefined(context.ariaActiveDescendant)}"    @keydown=${context._onkeydown}><div class="ui5-carousel-viewport ${classMap(context.classes.viewport)}"><div class="${classMap(context.classes.content)}" style="${styleMap(context.styles.content)}">            ${ repeat(context.items, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</div></div>        ${ context.arrows.content ? block2(context) : undefined }${ context.showNavigationArrows ? block3(context) : undefined }</div></section>`; };
const block1 = (item, index, context) => { return html`<div id="${ifDefined(item.id)}"                    class="ui5-carousel-item ${ifDefined(item.classes)}"                    style="width: ${ifDefined(item.width)}px;"                    role="option"                    aria-posinset="${ifDefined(item.posinset)}"                    aria-setsize="${ifDefined(item.setsize)}"                ><slot name="${ifDefined(item.item._individualSlot)}" tabindex="${ifDefined(item.tabIndex)}"></slot></div>            `; };
const block2 = (context) => { return html`<div class="ui5-carousel-navigation-arrows"><ui5-button                    arrow-back                    class="ui5-carousel-navigation-button ${classMap(context.classes.navPrevButton)}"                    icon="slim-arrow-left"                    tabindex="-1"                    @click=${context.navigateLeft}                    @keydown=${context._onbuttonkeydown}                ></ui5-button><ui5-button                    arrow-forward                    class="ui5-carousel-navigation-button ${classMap(context.classes.navNextButton)}"                    icon="slim-arrow-right"                    tabindex="-1"                    @click=${context.navigateRight}                    @keydown=${context._onbuttonkeydown}                ></ui5-button></div>        `; };
const block3 = (context) => { return html`<div class="${classMap(context.classes.navigation)}">                ${ context.arrows.navigation ? block4(context) : undefined }<div class="ui5-carousel-navigation">                    ${ context.isPageTypeDots ? block5(context) : block7(context) }</div>                ${ context.arrows.navigation ? block8(context) : undefined }</div>        `; };
const block4 = (context) => { return html`<ui5-button                    arrow-back                    class="ui5-carousel-navigation-button ${classMap(context.classes.navPrevButton)}"                    icon="slim-arrow-left"                    tabindex="-1"                    @click=${context.navigateLeft}                    @keydown=${context._onbuttonkeydown}                ></ui5-button>                `; };
const block5 = (context) => { return html`${ repeat(context.dots, (item, index) => item._id || index, (item, index) => block6(item, index, context)) }`; };
const block6 = (item, index, context) => { return html`<div                                role="img"                                aria-label="${ifDefined(item.ariaLabel)}"                                ?active="${item.active}"                                class="ui5-carousel-navigation-dot"                            ></div>                        `; };
const block7 = (context) => { return html`<ui5-label>${ifDefined(context.selectedIndexToShow)}&nbsp;${ifDefined(context.ofText)}&nbsp;${ifDefined(context.pagesCount)}</ui5-label>                    `; };
const block8 = (context) => { return html`<ui5-button                        arrow-forward                        class="ui5-carousel-navigation-button ${classMap(context.classes.navNextButton)}"                        icon="slim-arrow-right"                        tabindex="-1"                        @click=${context.navigateRight}                        @keydown=${context._onbuttonkeydown}                    ></ui5-button>                `; };

export default block0;
